contract DREEMlaunchpadVesting is Ownable, ReentrancyGuard {
    using SafeMath for uint256;
    using Address for address;

    struct LockInfo {
        address beneficiary;
        uint256 duration;
        uint256 periodicity;
        uint256 amount;
        uint256 cliffTime;
        uint256 released;
    }

    event TokenLocked(
        address beneficiary,
        uint256 duration,
        uint256 periodicity,
        uint256 amount,
        uint256 cliffTime,
        uint256 lockId,
        uint256 amountLocked
    );

    event TokenReleased(address beneficiary, uint256 amount, uint256 lockId);

    IERC20 public token;

    uint256 public lockCount;
    LockInfo[] public lockInfos;
    mapping(address => uint256[]) public lockIds;

    constructor(IERC20 _token) {
        require(address(_token) != address(0), "Token address can't be zero!");
        token = _token;
    }

    modifier validateLockId(uint256 lockId) {
        require(lockId < lockInfos.length, "Invalid lockId");
        _;
    }

    /**
     * get available amount of a certain lock
     */
    function getAvailableAmount(uint256 lockId)
        public
        view
        validateLockId(lockId)
        returns (uint256)
    {
        uint256 amount = lockInfos[lockId].amount;
        uint256 periodicity = lockInfos[lockId].periodicity;
        uint256 cliffTime = lockInfos[lockId].cliffTime;
        uint256 duration = lockInfos[lockId].duration;
        uint256 released = lockInfos[lockId].released;
        uint256 finalTime = cliffTime.add(duration).sub(periodicity);
        if (finalTime < block.timestamp) {
            return amount.sub(released);
        } else if (cliffTime > block.timestamp) {
            return uint256(0);
        } else {
            uint256 totalPeridicities = duration.div(periodicity);
            uint256 periodicityAmount = amount.div(totalPeridicities);
            uint256 currentperiodicityCount = (block.timestamp - cliffTime)
            .div(periodicity)
            .add(1);
            uint256 availableAmount = periodicityAmount.mul(
                currentperiodicityCount
            );
            return availableAmount.sub(released);
        }
    }

    function getLockIds(address beneficiary)
        external
        view
        returns (uint256[] memory)
    {
        require(beneficiary != address(0), "Invalid address!");
        return lockIds[beneficiary];
    }

    function getReleasableAmount(address beneficiary)
        external
        view
        returns (uint256)
    {
        require(beneficiary != address(0), "Invalid address!");

        uint256 available = uint256(0);
        uint256 length = lockIds[beneficiary].length;
        require(length > 0, "No locked token for this address");
        for (uint256 index = 0; index < length; ++index) {
            uint256 subAvailable = getAvailableAmount(
                lockIds[beneficiary][index]
            );
            available = available.add(subAvailable);
        }
        return available;
    }

    function _releaseAllAvailableTokens(address beneficiary)
        private
        returns (uint256)
    {
        uint256 available = uint256(0);
        uint256 length = lockIds[beneficiary].length;
        require(length > 0, "You don't have any locked token to release");
        for (uint256 index = 0; index < length; ++index) {
            uint256 lockId = lockIds[beneficiary][index];
            uint256 subAvailable = getAvailableAmount(lockId);
            if (subAvailable > 0) {
                available = available.add(subAvailable);
                lockInfos[lockId].released = lockInfos[lockId].released.add(
                    subAvailable
                );
                emit TokenReleased(beneficiary, subAvailable, lockId);
            }
        }
        if (available > 0) {
            token.transfer(beneficiary, available);
        }
        return available;
    }

    function ASelfClaimToMyWallet() external nonReentrant {
        uint256 releasedAmount = _releaseAllAvailableTokens(msg.sender);
        require(releasedAmount > 0, "You don't have any releasable amount yet");
    }

    function BAdminReleaseAllVestedTokensToSingleBeneficiary(address beneficiary)
        external
        nonReentrant
        onlyOwner
    {
        require(beneficiary != address(0), "Beneficiary can't be zero address");
        _releaseAllAvailableTokens(beneficiary);
    }

    function CAdminReleaseAllVestedTokensToSingleBeneficiary(
        address[] calldata beneficiaries
    ) external nonReentrant onlyOwner {
        uint256 total = beneficiaries.length;

        for (uint256 index = 0; index < total; index++) {
            require(
                beneficiaries[index] != address(0),
                "Beneficiary can't be zero address"
            );
            _releaseAllAvailableTokens(beneficiaries[index]);
        }
    }

    function EAdminBatchLockTokens(
        address[] calldata beneficiaries,
        uint256[] calldata durations,
        uint256[] calldata peridicities,
        uint256[] calldata amounts,
        uint256[] calldata cliffTimes,
        uint256[] calldata permilleReleasedAtStarts
    ) external onlyOwner {
        require(beneficiaries.length == durations.length, "Invalid params");
        require(beneficiaries.length == peridicities.length, "Invalid params");
        require(beneficiaries.length == amounts.length, "Invalid params");
        require(beneficiaries.length == cliffTimes.length, "Invalid params");
        require(
            beneficiaries.length == permilleReleasedAtStarts.length,
            "Invalid params"
        );
        uint256 total = beneficiaries.length;

        for (uint256 index = 0; index < total; index++) {
            _lockTokens(
                beneficiaries[index],
                durations[index],
                peridicities[index],
                amounts[index],
                cliffTimes[index],
                permilleReleasedAtStarts[index]
            );
        }
    }

    /**
     * Lock Tokens
     *
     * @param beneficiary               address of beneficiary
     * @param duration                  total duration
     * @param periodicity                periodicity
     * @param amount                    total amount of token
     * @param cliffTime                 timestamp of cliffTime
     * @param permilleReleasedAtStart    1000: 100%, 15: 1.5%
     */
    function DAdminLockTokens(
        address beneficiary,
        uint256 duration,
        uint256 periodicity,
        uint256 amount,
        uint256 cliffTime,
        uint256 permilleReleasedAtStart
    ) external onlyOwner {
        _lockTokens(
            beneficiary,
            duration,
            periodicity,
            amount,
            cliffTime,
            permilleReleasedAtStart
        );
    }

    function _lockTokens(
        address beneficiary,
        uint256 duration,
        uint256 periodicity,
        uint256 amount,
        uint256 cliffTime,
        uint256 permilleReleasedAtStart
    ) private {
        require(
            cliffTime > block.timestamp,
            "CliffTime should be greater than current time"
        );
        require(periodicity > 0, "Periodicity should be greater than zero");
        require(
            duration >= periodicity,
            "Duration should be greater than periodicity"
        );
        require(
            duration.sub(duration.div(periodicity).mul(periodicity)) == 0,
            "Duration should be divided by periodicity completely"
        );
        require(amount > 0, "Amount should be greater than zero");
        require(beneficiary != address(0), "Beneficiary can't be zero address");
        require(
            permilleReleasedAtStart < 1000,
            "PermilleReleasedAtStart should be less than 100%(1000)"
        );

        uint256 amountToReleaseAtStart = amount
        .mul(permilleReleasedAtStart)
        .div(1000);
        uint256 amountToLock = amount.sub(amountToReleaseAtStart);

        uint256 lockLength = lockInfos.length;
        lockInfos.push(
            LockInfo({
                beneficiary: beneficiary,
                duration: duration,
                periodicity: periodicity,
                amount: amountToLock,
                cliffTime: cliffTime,
                released: uint256(0)
            })
        );
        lockIds[beneficiary].push(lockLength);
        lockCount = lockCount + 1;

        emit TokenLocked(
            beneficiary,
            duration,
            periodicity,
            amount,
            cliffTime,
            lockLength,
            amountToLock
        );
        token.transferFrom(msg.sender, address(this), amountToLock);
        if (amountToReleaseAtStart > 0) {
            token.transferFrom(msg.sender, beneficiary, amountToReleaseAtStart);
        }
    }
}

